import React from 'react'
import { SafeAreaView, ScrollView, StyleSheet, Text, View } from 'react-native'
import CustomLinkList from '../componets/CustomListItem';
const HomeScreen = () => {
    return (
        <SafeAreaView>
            <ScrollView>
                <CustomLinkList />
            </ScrollView>
        </SafeAreaView>
    )
}

export default HomeScreen

const styles = StyleSheet.create({})
